import React from "react";

function EmailVerify() {
  return (
    <div>
      <div className="container2">
        {/* Rest of the form */}
        <div className="centered-content1">
          <div className="row">
            <div className="col justify-center changed">
              Email Verified
            </div>
          </div>
        </div>
        {/* Rest of the form */}
      </div>
    </div>
  );
}

export default EmailVerify;
